import React from 'react';
import Pic from './Pic.js';


const Pictures = (props) => {
    var keys = [] 


	return (

		<div>
    {   keys.map((pokemonkey,i)=>{
    	 return <Pic key = {i+1} pokemonkey={pokemonkey}  clickFunction={props.clickFunction} />

	})
}

	</div>

    )




}



export default Pictures;
